Season 5, Episode 19: Mercy
Original Air Date 20 April 2006
Lionel Luthor is chased by a man with mask and forced to play hangman to save his life when he traps Lionel in his limo in the path of a moving train. Later, he is abducted by the same stranger who places Lionel in an abandoned warehouse where he has to play lethal 'Jigsaw' type games to survive. Martha is also kidnapped and in his last test, the life of Martha is also put at stake and Lionel has to fight to save her life. Meanwhile, Chloe, Clark and Lex join forces trying to find Martha and Lionel.

Season 5, Episode 20: Fade
Original Air Date 27 April 2006
Standing outside the Metropolis courthouse with Chloe, Clark saves Graham Garrett from a car which would have crushed him. Graham insists to repay the favor by offering Clark whatever he wants, including the opportunity to be with Lana again by trying to kill Lex Luthor after Clark found out about heir affair. Graham later turns out to be a hired killer with chameleon powers that render him invisible. Clark also gets angry at Chloe for keeping Lana and Lex's affair from him. When Clark realizes that Graham wants to kill Lex, Clark wrestles with a moral dilemma whether or not to let him.


